import { Link } from "react-router-dom";
import constants from '../utils/constants';


class Nav extends Component {
    render() {
        var Navigation = [] = constants.NAV_ARRAY;

        return (
            <div className="Nav">
                <ul>
                    {Navigation.map}
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/about">About</Link>
                    </li>
                    <li>
                        <Link to="/topics">Comics</Link>
                    </li>
                </ul>
                <hr/>
            </div>
        );
    }
}
export default Nav;
